import React, { useState } from 'react';



const App = () => {

    const [count, setCount] = useState(0);

    let newTime = new Date().toLocaleTimeString();
    const [time,setTime] = useState(newTime);

    const [ctime,setcTime] = useState(newTime);


    const IncNum = () => {
        setCount(count + 1);
        console.log("clicked")
    }

    const IncTime = () => {
        let newTime = new Date().toLocaleTimeString();
        console.log(newTime);
        setTime(newTime);
        console.log("clicked")
    }

    const timeNow = () => {
        let newTime = new Date().toLocaleTimeString();
        console.log(newTime);

        setTime(newTime);
        console.log("clicked")
    }

    setInterval(timeNow,1000);

    return (
        <>
            <div className="body">
                <h3 onLoad={timeNow}>{ctime}</h3>

                <h1>{count}</h1>
                <button className="buttonA" onClick={IncNum}>Click Me</button>

                <h2>{time}</h2>
                <button className="buttonB" onClick={IncTime}> Get Time</button>

            </div>

        </>
    );

};

export default App;
